import React from 'react';
import InputModel from '../Input/Input';
import FormWrapper from '../FormWrapper/FormWrapper';
import { Link } from 'react-router-dom';
import { useFormContext } from '../FormContext/FormContext'; 

const FormLogin: React.FC = () => {
  const { register, formState: { errors } } = useFormContext(); 

  const handleSubmit = (data: any) => {
    
    window.location.reload();

  };

  return (
    <>
      <FormWrapper onSubmit={handleSubmit} 
      buttonText="Login" heading="Entre na sua conta">
        <InputModel register={register} type="email" 
        placeholder="Enter your email" 
        error={errors?.email && 'Email is required'} /> 
      </FormWrapper>
      <hr />
      <div className="flex flex-col gap-3 my-5">
        <a
          className="w-full text-center p-4 font-medium border border-black rounded-xl hover:bg-black hover:text-white text-heading-blue-secondary text-2xl flex justify-center gap-2"
          href=""
        >
          <img src="/Google.svg" className="w-7" alt="Google Icon" /> Continue with Google
        </a>
        <p className="text-gray-600 text-lg">
          NÃ£o tem conta ainda? <Link className="hover:underline" to="/Register">Cadastre-se</Link>
        </p>
      </div>
    </>
  );
};

export default FormLogin;
